  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from the U.S. Census Bureau's Master Address File / Topologically Integrated Geographic
  Encoding and Referencing (MAF/TIGER) Database (MTDB).  The MTDB represents a seamless
  national file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
  is designed to stand alone as an independent data set, or they can be combined to
  cover the entire nation.nn nAmerican Indian tribal subdivisions are administrative
  subdivisions of federally recognized American Indian reservations/off-reservation
  trust lands or Oklahoma tribal statistical areas (OTSAs).  These entities are internal
  units of self-government and/or administration that serve social, cultural, and/or
  economic purposes for the American Indian tribe or tribes on the reservations/off-reservation
  trust lands or OTSAs.  The Census Bureau obtains the boundary and attribute information
  for tribal subdivisions on federally recognized American Indian reservations and
  off-reservation trust lands from federally recognized tribal governments through
  the Census Bureau's Boundary and Annexation Survey (BAS).  For the 2010 Census,
  the boundaries for tribal subdivisions on OTSAs were also obtained from federally
  recognized tribal governments through the Tribal Statistical Areas Program (TSAP).
  \ Note that tribal subdivisions do not exist on all reservations/off-reservation
  trust lands or OTSAs, rather only where they were submitted to the Census Bureau
  by the federally recognized tribal government for that area.  nn nThe boundaries
  for American Indian tribal subdivisions are as of January 1, 2015, as reported by
  the federally recognized tribal governments through the Census Bureau's Boundary
  and Annexation Survey (BAS).nn nThe boundaries for tribal subdivisions on OTSAs
  are those reported as of January 1, 2010 through TSAP.n\",\n\t\"license_title\":
